import React, {useState} from 'react'

export default function AboutMe() {

    const [width1, setWidth1] = useState(3);
    const [width2, setWidth2] = useState("5rem");
    const [width3, setWidth3] = useState("4rem");
    const [rotate1, setRotate1] = useState("0deg");
    const [rotate2, setRotate2] = useState("40deg");
    const [rotate3, setRotate3] = useState("100deg");
    const [distance1, setDistance1] = useState("2.5rem");
    const [distance2, setDistance2] = useState("4.5rem");
    const [distance3, setDistance3] = useState("3.5rem");
    
    return (
        <section className="about-me">
            <div className="about-me__circle">
                <div className="about-me__circle__line" style={{width: "2rem"}}>
                    <div className="about-me__circle__line-circle"></div>
                </div>
                <div className="about-me__circle__line">
                    <div className="about-me__circle__line-circle"></div>
                </div>
                <div className="about-me__circle__line">
                    <div className="about-me__circle__line-circle"></div>
                </div>
            </div>
        </section>
    )
}
